import {
  SlBadge
} from "./chunk.KJ4WE367.js";

// src/react/badge/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-badge";
SlBadge.define("sl-badge");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlBadge,
  react: React,
  events: {},
  displayName: "SlBadge"
});
var badge_default = reactWrapper;

export {
  badge_default
};
